```#include <Servo.h>
const int trigPin = 2;
const int echoPin = 3;
int ang;
const int maxdist=50;
long duration=0;
int distance=0;
bool scream=true;
int dist;
const int screampin=5;
const unsigned long sensor_interval=1;
const unsigned long servo_interval=2;
unsigned sensor_run=0;
unsigned servo_run=0;
Servo senvro;
void setup() {
servo_run=millis();
sensor_run=millis();
pinMode(trigPin, OUTPUT); // Sets the trigPin as an Output
pinMode(echoPin, INPUT); // Sets the echoPin as an Input
pinMode(9,OUTPUT); // Set the fucking shit to fuck
pinMode(screampin,OUTPUT);
senvro.attach(9);
Serial.begin(9600);
}
int getdist(){
// Clears the trigPin
digitalWrite(trigPin, LOW);
delayMicroseconds(5);
// Sets the trigPin on HIGH state for 10 micro seconds
digitalWrite(trigPin, HIGH);
delayMicroseconds(10);
digitalWrite(trigPin, LOW);
// Reads the echoPin, returns the sound wave travel time in microseconds
duration = pulseIn(echoPin, HIGH,10000);
// Calculating the distance
distance= duration*0.034/2;
sensor_run=millis();
return distance;
}

void incServo(){
if(ang < 89){
 ang++;
}else{
 ang=1;
}
senvro.write(ang);
delay(15);
servo_run=millis();
}
void loop(){
  if( (millis()-sensor_run ) >= sensor_interval){
  distance=getdist();
  }
  if(distance < maxdist && distance > 0){
  Serial.println(distance);    
  analogWrite(screampin,distance);
  delay(3000);
  }else{
  analogWrite(screampin,0);
  }
  if ( (millis()-servo_run) >= servo_interval){
  incServo(); 

  }
}```
